import React, {Component} from 'react';
import { StyleSheet, css } from 'aphrodite';
import createlogo from './Create Subscriber.png';
import decommlogo from './Decommission.png';
import {Row, Coloum} from 'simple-flexbox';
import CreateSubscriber from '../../CreateSubscriber/CreateSubscriber';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

const styles = StyleSheet.create({
    imageicons:{
        height:'190px',
        width: '80px',
        justifyContent:'center',
        borderRadius:'10px',
        paddingTop:"30px",
        paddingBottom:"80px",
        },
    separator: {
        paddingTop: '20px',
        borderTop: '0.5vh solid ',
        padding:0,
        left:0,
        marginTop: '10px',
        opacity: 0.06
    },
    text:{
        paddingTop:'30px',
        fontFamily: 'Muli',
        fontSize: '20px',
        fontWeight:'bold',
        textAlignLast:'center',
        lineHeight: '12px',
        letterSpacing: '0.2px',
        color: 'black',
    }
    }
)

class SaasCard extends Component {

    render(){
        return(
            <Row>
                <Router>
                    <Link to="/createsubscriber">
                        <div className= 'tc dib br3 ba b--light-gray pa3 ma2 bw2 pointer w5'>
                            <img alt='robots' src= {createlogo} className={css(styles.imageicons)}/>
                            <div className={css(styles.separator)}></div>
                            <div>
                                <p className={css(styles.text)}>Create Subscriber</p>
                            </div>
                        </div>
                    </Link>
                    <div className= 'tc dib br3 ba b--light-gray pa3 ma2 bw2 pointer w5'>
                        <img alt='robots' src= {decommlogo} className={css(styles.imageicons)}/>
                        <div className={css(styles.separator)}></div>
                        <div>
                            <p className={css(styles.text)}>Decommission</p>
                        </div>
                    </div>
                    <Switch>
                        <Route path="/createsubscriber" component={CreateSubscriber}/>
                    </Switch>
                </Router>
            </Row>
            )
    }

}

export default SaasCard;
